public class Solution {
    public int MinimumChanges(string s, int k) {
        int n = s.Length;
        int[,,] dp = new int[n + 1, k + 1, n / 2 + 1];
        for (int i = 0; i <= n; i++)
            for (int j = 0; j <= k; j++)
                for (int l = 0; l <= n / 2; l++)
                    dp[i, j, l] = int.MaxValue / 2;
        dp[0, 0, 0] = 0;

        for (int i = 0; i < n; i++) {
            for (int j = 1; j <= k; j++) {
                for (int l = 0; l < i; l++) {
                    for (int d = 1; d <= (i - l) / 2; d++) {
                        if ((i - l) % d == 0) {
                            int changes = 0;
                            for (int start = 0; start < d; start++) {
                                int[] freq = new int[26];
                                int maxFreq = 0, total = 0;
                                for (int index = l + start; index <= i; index += d) {
                                    maxFreq = Math.Max(maxFreq, ++freq[s[index] - 'a']);
                                    total++;
                                }
                                changes += total - maxFreq;
                            }
                            dp[i + 1, j, d] = Math.Min(dp[i + 1, j, d], dp[l, j - 1, 0] + changes);
                        }
                    }
                }
            }
        }

        int answer = int.MaxValue;
        for (int d = 1; d <= n / 2; d++)
            answer = Math.Min(answer, dp[n, k, d]);
        return answer == int.MaxValue / 2 ? 0 : answer;
    }
}
